/********************************************************************
* FUNCTION CoreModel_CoreNetworkModule_ObjectClasses_NetworkElement_edit
* 
* Edit database object callback
* Path: /NetworkElement
* Add object instrumentation in COMMIT phase.
* 
* INPUTS:
*     see agt/agt_cb.h for details
* 
* RETURNS:
*     error status
********************************************************************/
static status_t CoreModel_CoreNetworkModule_ObjectClasses_NetworkElement_edit (
    ses_cb_t *scb,
    rpc_msg_t *msg,
    agt_cbtyp_t cbtyp,
    op_editop_t editop,
    val_value_t *newval,
    val_value_t *curval)
{
    status_t res = NO_ERR;
    val_value_t *errorval = (curval) ? curval : newval;

    if (LOGDEBUG) {
        log_debug("\nEnter CoreModel_CoreNetworkModule_ObjectClasses_NetworkElement_edit callback for %s phase",
            agt_cbtype_name(cbtyp));
    }

    res = u_CoreModel_CoreNetworkModule_ObjectClasses_NetworkElement_edit(scb, msg, cbtyp, editop, newval, curval);

    if (res == NO_ERR && cbtyp == AGT_CB_COMMIT) {
        res = agt_check_cache(&NetworkElement_val, newval, curval, editop);
    }
    
    if (res == NO_ERR && cbtyp == AGT_CB_COMMIT && curval == NULL) {
        res = CoreModel_CoreNetworkModule_ObjectClasses_NetworkElement_mro(newval);
    }

    if (res != NO_ERR) {
        agt_record_error(
            scb,
            &msg->mhdr,
            NCX_LAYER_CONTENT,
            res,
            NULL,
            (errorval) ? NCX_NT_VAL : NCX_NT_NONE,
            errorval,
            (errorval) ? NCX_NT_VAL : NCX_NT_NONE,
            errorval);
    }
    return res;

} /* CoreModel_CoreNetworkModule_ObjectClasses_NetworkElement_edit */

